                    <div>
                                <h3>micho</h3>
                <div class="Post-body">
                    <p><a href="1033.html" class="PostMention" data-id="196450">[obrisani korisnik]</a> Hmm ne bih znao jer osobno ne prolazim kroz prijave, nego moji mentori.</p>

<p>Koliko je meni poznato mi toliko ne tražimo kompetencije već volju za radom. Ponekad je to vidljivo kroz projekte, ponekad ti treba razgovor. Kod mene osobno se to očitovalo na razgovoru, koliko su mi rekli. Vjerojatno je distribucija slična normalnoj raspodijeli RZ-a, tj. da onako kako izgleda RZ vjv izgledaju i te prijave.</p>

<p>Ako je tako, onda 10% ljudi nema pojma programirati, 50% ljudi vjerojatno zanima AI i znaju programirati ali izvan radova na faksu nemaju projekata, 30% ljudi vjerojatno i ima solo projekata ali ništa posebno, dok ih je 10% Šnajderjugend - znači ljudi koji su em na faksu jako u tome, em znaju dosta teorije i van faksa/radili su osobno projekte. Ali to je moja procjena RZ-a koja nit mora biti sama po sebi točna, nit mora korespondirati s profil ljudi koji se kod nas prijavljuju.</p>

<p>Ono što mogu reći sa sigurnošću je da se kod nas ne prijavljuje sav Šnajderjugend, npr., i da se uglavnom prijave ljudi na 3. godini (vjerojatno zato što ih je i najviše tad zainteresirano za praksu u smislu brojeva). Ali isto tako ne znam baš Šnajderjugend pripadnika/icu kojeg su odbili, isto moguće da samo nisam čuo jer se s takvim ljudima ne družim previše.</p>
                </div>
            </div>
